import React, { FC, PropsWithChildren } from 'react';
import Link from 'next/link';

export const AppLayout: FC<PropsWithChildren> = ({ children }) => {
  return (
    <div>
      <div>
        <Link href={'/'}>
          <a>Home</a>
        </Link>
        <Link href={'/profile'}>
          <a>Profile</a>
        </Link>
        <Link href={'/signup'}>
          <a>Signup</a>
        </Link>
      </div>
      {children}
    </div>
  );
};
